import React from 'react';

function RecipeDisplay({queryData}) {
	let recipes = [];

	function makeRecipeDisplay(label, image, url, key) {
		return (
			<img src={image} rounded alt={label}/>
		)
		/*return(
			<div key={key}>
				{label}
				<br></br>
				<img source={image} alt={label}/>
				<br></br>
				{url}
			</div>
		)*/
	}

	if(queryData) {
		for(let i = 0; i < queryData.hits.length; i++) {
			recipes.push(makeRecipeDisplay(queryData.hits[i].label, queryData.hits[i].image, queryData.hits[i].url, i));
		}

		var recipeDisplay = queryData.hits.map(function(hit) {
			return(
				<div>
					{hit.label}
					<br></br>
					<img source={hit.image} alt={hit.label}/>
					<br></br>
					{hit.url}
				</div>
			)
		})
	}

	return (
		<div>
			{recipeDisplay}
		</div>
	)
}

export default RecipeDisplay;
